--
-- TOC entry 244 (class 1255 OID 68378)
-- Name: pagar_lugar(); Type: FUNCTION; Schema: public; Owner: [postgres]
--

CREATE FUNCTION public.pagar_lugar() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
	userid integer;
	userbi text;
	usernif text;
	tempoatual timestamp without time zone := current_timestamp;
	codtipo smallint;
	precolugar real;
	metodopagamento char(1);
	saldouser real;
	codzona integer;
	secsdiff bigint;
	custolugar real;
	-- resultado em formato time (HOUR:MINUTE:SECOND) com a diferença entre o tempoatual e o tempoinicio
	timeocupado time without time zone := (SELECT tempoatual::time - OLD.tempoinicio::time);
BEGIN
	-- guarda nas variáveis userid, userbi e usernif os dados do utilizador na qual pertence a matrícula do veículo que está estacionado no lugar
	SELECT v."utilizador_detalhesutilizador_userid", v."utilizador_detalhesutilizador_bi", v."utilizador_detalhesutilizador_nif" INTO userid, userbi, usernif
	FROM veiculo v
	WHERE v.matricula = NEW."veiculo_matricula";

	-- guarda na variável codzona o código da zona onde está estacionado o veículo
	SELECT g.codzona INTO codzona
	FROM getlugarprecoporzona g
	WHERE idest = NEW."estacionamento_idest";

	-- verifica se o lugar estacionamento passou de livre (0) para ocupado (1)
	IF NEW.estado = 1 THEN

		-- verifica se foi verificada matrícula que pertence à BD
		IF NEW."veiculo_matricula" IS NOT NULL THEN
	
			-- insere na tabela utilizadorestacionamento os dados do utilizador que está a usar o estacionamento atual
			VALUES(DEFAULT,userid,userbi,usernif,NEW."veiculo_matricula",OLD.numlugar,OLD."estacionamento_idest",codzona,DEFAULT);
		END IF;
		-- define a hora atual na nova linha
		NEW.tempoinicio := current_timestamp;
		RETURN NEW;
	END IF;
		
	-- verifica se o lugar estacionamento passou de ocupado (1) para livre (0) e se o registo de matrícula é não nulo
	IF NEW.estado = 0 AND OLD."veiculo_matricula" IS NOT NULL THEN

		-- apaga o registo da matrícula da tabela utilizadorestacionamento indicando que está a usar neste momento o lugar do estacionamento
		DELETE FROM utilizadorestacionamento
		WHERE OLD."veiculo_matricula" = "veiculo_matricula";

		-- guarda nas variáveis metodopagamento e saldouser o método de pagamento escolhido pelo user e o seu saldo atual
		SELECT u.metodopagamento, u.saldo INTO metodopagamento, saldouser
		FROM utilizadorsaldo u
		WHERE u."utilizador_detalhesutilizador_userid" = userid;

		-- atribui à variável codtipo o tipo de utilizador na qual está inserido o user (Ordinário ou Premium)
		SELECT u."precoutilizador_codtipo" INTO codtipo
		FROM utilizador u
		WHERE u."detalhesutilizador_userid" = userid;

		-- diferença das datas de tempo início registado na tabela e o tempo atual após o estado ter passado de 1 para 0
		/* diferença das datas em segundos:
		DATE_PART('day', tempoatual - OLD.tempoinicio) * 24 + DATE_PART('hour', tempoatual - OLD.tempoinicio) * 60 + DATE_PART ('minute', tempoatual - OLD.tempoinicio) 
		* 60 + DATE_PART ('second', tempoatual - OLD.tempoinicio) */
		secsdiff := DATE_PART('day',tempoatual - OLD.tempoinicio) * 24 + DATE_PART('hour',tempoatual - OLD.tempoinicio) * 60 + 
		DATE_PART('minute', tempoatual - OLD.tempoinicio) * 60 + DATE_PART('second', tempoatual - OLD.tempoinicio);

		-- atribui ao custolugar o preço do lugar consoante o tipo de user da view getlugarprecoporzona, convertendo o preço p/hora para p/segundo
		custolugar := ((SELECT CASE WHEN codtipo = 0 THEN g.custoordinario ELSE g.custopremium END FROM getlugarprecoporzona g WHERE g.numlugar = OLD.numlugar) / 60) / 60;

		-- atribui ao precolugar o custo total do lugar resultando o produto entre os segundos e o custo do lugar
		precolugar := secsdiff * custolugar;

		-- caso o saldo do utilizador não seja suficiente para pagar o lugar
		IF precolugar > saldouser THEN
			-- insere na tabela multa todos os dados pessoais do user
			VALUES(DEFAULT,'Saldo insuficiente',precolugar + 3,0,metodopagamento,userid,userbi,usernif,OLD."veiculo_matricula",OLD.numlugar,OLD."estacionamento_idest",
			codzona,OLD.tempoinicio,DEFAULT);
			
		ELSE
			-- atualiza o campo saldo do utilizador subtraindo o valor a pagar pelo saldo atual
			UPDATE utilizadorsaldo
			SET saldo = saldo - precolugar
			WHERE "utilizador_detalhesutilizador_userid" = userid;
			
			-- insere na tabela ordempagamento os dados pessoais do utilizador, incluindo o valor pago
			VALUES(DEFAULT,precolugar,metodopagamento,userid,userbi,usernif,OLD."veiculo_matricula",OLD.numlugar,OLD."estacionamento_idest",
			codzona,OLD.tempoinicio,DEFAULT);
			
		END IF;

		-- insere na tabela tempoestacionado os dados pessoais e o tempo de estacionamento do user
		VALUES(DEFAULT,userid,userbi,usernif,OLD."veiculo_matricula",timeocupado,OLD.tempoinicio,tempoatual);
		
		-- após inserir ou fazer o UPDATE na tabela tempoestacionado atribui NULL aos campos tempoinicio e veiculo_matricula da própria tabela
		NEW.tempoinicio := NULL;
		NEW."veiculo_matricula" := NULL;
		RETURN NEW;

	-- caso não tenha sido verificada nenhuma matrícula pertencente à BD
	ELSE
		-- apaga o tempo no campo tempoinicio
		NEW.tempoinicio := NULL;
		RETURN NEW;
		
	END IF;
	RETURN NEW;
END;
$$;


ALTER FUNCTION public.pagar_lugar() OWNER TO "[postgres]";

--
-- TOC entry 236 (class 1255 OID 62934)
-- Name: pagar_multa(); Type: FUNCTION; Schema: public; Owner: [postgres]
--

CREATE FUNCTION public.pagar_multa() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
	tipopago smallint;
	customulta real;
BEGIN
	-- verifica se foi efetuado algum UPDATE no registo
	IF TG_OP = 'UPDATE' THEN
		-- guarda nas variáveis tipopago e customulta o tipo de pagamento (0 - ainda não pagou, 1 - pago) e o valor da coima, respetivamente
		SELECT m.tipopago, m.valor INTO tipopago, customulta 
		FROM multa m
		WHERE OLD."utilizador_detalhesutilizador_userid" = m."utilizador_detalhesutilizador_userid";

		-- caso o tipo de pagamento seja igual a 0
		IF tipopago = 0 THEN
			-- verifica se o saldo atualizado é suficiente para pagar o valor da coima
			IF NEW.saldo >= customulta THEN
				-- atualiza o estado da multa para pago (tipopago = 1)
				UPDATE multa
				SET tipopago = 1
				WHERE OLD."utilizador_detalhesutilizador_userid" = "utilizador_detalhesutilizador_userid";

				-- tira o valor da multa ao saldo do user
				NEW.saldo := NEW.saldo - customulta;
				RETURN NEW;
			END IF;
		END IF;
	END IF;
	RETURN NEW;
END;
$$;


ALTER FUNCTION public.pagar_multa() OWNER TO "[postgres]";

