CREATE FUNCTION public.premiumconta(bi text) RETURNS void
    LANGUAGE plpgsql
    AS $_$
DECLARE
	preco real := (SELECT preco FROM precoutilizador WHERE codtipo = 1);
BEGIN
	-- altera o tipo de user para 1 (Premium)
	UPDATE utilizador SET "precoutilizador_codtipo" = 1 WHERE "detalhesutilizador_bi" = $1;
	-- retira o custo da conta Premium ao saldo do user
	UPDATE utilizadorsaldo SET saldo = saldo - preco WHERE "utilizador_detalhesutilizador_bi" = $1;
END;
$_$;


