CREATE FUNCTION public.setpremiumconta(login text) RETURNS void
    LANGUAGE plpgsql
    AS $_$
DECLARE
	biuser text;
	preco real := (SELECT preco FROM precoutilizador WHERE codtipo = 1);
BEGIN
	biuser := (SELECT bi FROM detalhesutilizador WHERE email = $1);

	IF biuser IS NULL THEN
		biuser := (SELECT d.bi FROM detalhesutilizador d INNER JOIN utilizador u ON u."detalhesutilizador_userid" = d.userid AND u."detalhesutilizador_bi" = d.bi AND u."detalhesutilizador_nif" = d.nif WHERE u.telemovel = $1);
	END IF;
	
	-- altera o tipo de user para 1 (Premium)
	UPDATE utilizador
	SET "precoutilizador_codtipo" = 1
	WHERE "detalhesutilizador_bi" = biuser;
	-- retira o custo da conta Premium ao saldo do user
	UPDATE utilizadorsaldo
	SET saldo = saldo - preco
	WHERE "utilizador_detalhesutilizador_bi" = biuser;
		
END;
$_$;


