--
-- TOC entry 287 (class 1255 OID 58684)
-- Name: setzonaprecotime(); Type: FUNCTION; Schema: public; Owner: [postgres]
--

CREATE FUNCTION public.setzonaprecotime() RETURNS void
    LANGUAGE plpgsql
    AS $$
-- declara as variáveis
DECLARE
	-- guarda a hora atual no formato HOUR:MINUTES:SECONDS numa variável
	currenttime time := to_char(current_timestamp, 'HH24:MI:SS');
	-- guarda o dia atual no formato inteiro: Domingo (1) até Sábado (7)
	currentday integer := to_char(current_timestamp, 'D');
-- inicia as instruções
BEGIN
	-- caso a hora atual e/ou dia atual seja igual às condições abaixo, aumenta o preço para mais 3
	IF (currenttime = '08:00:00' OR currenttime = '13:00:00' AND currentday IN(2,3,4,5,6)) OR (currentday = 6 AND currenttime = '21:00:00') OR (currentday = 7 AND currenttime = '21:00:00') THEN
		UPDATE zona
		SET custoordinario = custoordinario + 3;
	-- se a condição acima for falsa e a condição abaixo for verdadeira, desce o preço atual das zona para menos 3
	ELSIF (currenttime = '10:00:00' OR currenttime = '15:00:00' AND currentday IN(2,3,4,5,6)) OR (currentday = 7 AND currenttime = '03:00:00') OR (currentday = 1 AND currenttime = '03:00:00') THEN
		UPDATE zona
		SET custoordinario = custooordinario - 3;
	-- fim das condições
	END IF;
-- fim das instruções
END;
$$;


ALTER FUNCTION public.setzonaprecotime() OWNER TO "[postgres]";

