CREATE VIEW public.gettopusers AS
 SELECT d.bi,
    d.nif,
    d.nome,
    d.morada,
    d.codpostal,
    u.telemovel,
    sum((o.valor)::real) AS valortotal
   FROM ((public.detalhesutilizador d
     JOIN public.utilizador u ON ((d.userid = u.detalhesutilizador_userid)))
     JOIN public.ordempagamento o ON ((u.detalhesutilizador_userid = o.utilizador_detalhesutilizador_userid)))
  GROUP BY d.bi, d.nif, d.nome, d.morada, d.codpostal, u.telemovel
  ORDER BY (sum((o.valor)::real)) DESC;


