--
-- TOC entry 213 (class 1259 OID 70404)
-- Name: historicopagamento; Type: VIEW; Schema: public; Owner: [postgres]
--

CREATE VIEW public.historicopagamento AS
 SELECT u.detalhesutilizador_userid AS userid,
    d.nome,
    d.email,
    u.telemovel,
    e.rua,
    e.codpostal,
    o.valor,
    to_char(o.tempoinicio, 'YYYY-MM-DD'::text) AS datainicio,
    to_char(o.tempoinicio, 'HH24:MI:SS'::text) AS tempoinicio,
    to_char(o.tempoatual, 'YYYY-MM-DD'::text) AS datafim,
    to_char(o.tempoatual, 'HH24:MI:SS'::text) AS tempofim
   FROM ((((public.ordempagamento o
     JOIN public.utilizador u ON ((u.detalhesutilizador_userid = o.utilizador_detalhesutilizador_userid)))
     JOIN public.detalhesutilizador d ON ((d.userid = u.detalhesutilizador_userid)))
     JOIN public.lugar l ON (((l.estacionamento_idest = o.lugar_estacionamento_idest) AND (l.numlugar = o.lugar_numlugar))))
     JOIN public.estacionamento e ON ((e.idest = l.estacionamento_idest)))
  ORDER BY u.detalhesutilizador_userid;


ALTER TABLE public.historicopagamento OWNER TO "[postgres]";

